import React from 'react';
import './Header.css';
import logo from './logo.png';

const Header = () => {
  return (
    <header>
      <nav>
      <div className="logo-container">
            <img src={logo} alt="Logo" className="logo" />
        </div>  
        <ul>
          <li>Home</li>
          <li>About</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
